import React, {Component} from 'react';
import {Route, Switch} from "react-router-dom";
import HomePage from "./home/HomePage";

class Public extends Component {
    render() {
        return (
            <Switch>
                <Route path={"/"} exact component={HomePage}/>
            </Switch>
        );
    }
}

export default Public;
